import React from 'react';

const EditIcon = () => {
  return (
    <svg
      xmlns="http://www.w3.org/2000/svg"
      viewBox="0 0 24 24"
      width="24"
      height="24"
      fill="none"
      stroke="currentColor"
      strokeWidth="2"
      strokeLinecap="round"
      strokeLinejoin="round"
    >
      <path d="M12 19h9"></path>
      <path d="M4 6h16"></path>
      <path d="M12 1v6"></path>
    </svg>
  );
};

export default EditIcon;
